import "./App.css";
import React from "react";
import ArtistCard from "./Components/artist-card.js";
import SearchBar from "./Components/search-bar.js";
import SearchResult from "./Components/search-result.js";
class PageSearchResult extends React.Component {
  state = {
    busqueda: "",
  };
  componentDidMount() {
    let search = this.props.history.location.search
      .subtr(1)
      .replace("%20", " ");
    console.log(search, "Lo que me trae de la URL");
  }

  componentWillMount() {
    console.log("componentWillMount()", "Antes del método render");
  }

  componentWillUnmount() {
    console.log("componentWillUnmount()", "Cuando me fui");
  }
  changeHandle = (e) => {
    this.setState({
      [e.target.name]: e.target.value,
    });
  };
  render() {
    console.log("render()");
    return (
      <React.Fragment>
        <SearchBar
          onChange={this.changeHandle}
          busqueda={this.state.busqueda}
        />

        <SearchResult busqueda={this.state.busqueda} />
      </React.Fragment>
    );
  }
}

export default PageSearchResult;
